import React from 'react';

const ChePapers = () => {
  return (
    <>
      <div class="bg-yellow-100 relative overflow-hidden h-screen z-0 ">
        <div class="inset-0 bg-black opacity-25 absolute"></div>
        <div class="container mx-auto px-6 md:px-12 relative z-10 flex items-center py-32 xl:py-40">
          <div class="w-full font-mono flex flex-col items-center relative z-10">
            <h1 class=" font-extrabold text-2xl text-center text-white  mt-4">
              Coming Soon...
            </h1>
            <h1 class="font-extrabold text-2xl text-center text-white  mt-4">
              Send us Papers on the Contribute section to help us have more and
              more resources.
            </h1>
            <p class="font-extrabold text-5xl my-20 text-white animate-bounce">
              Thankyou
            </p>
          </div>
        </div>
      </div>
    </>
  );
};
export default ChePapers;
